import React, {Component} from 'react'
import { withRouter } from 'react-router'


class ViewGalleryButton extends Component {

  handleClick = () => {
    this.props.router.push('/gallery')
  }

  render() {
    return (
      <button id="view-gallery-button" onClick={this.handleClick.bind(this)}>
        Click here to view saved drawings!
      </button>
    )
  }

}

export default withRouter(ViewGalleryButton)
